import React from "react";
import MovieList from "../movieList/MovieList";
import Navbar from "../navbar/Navbar";

function MovieLibraryF() {
  return (
    <div className="movie-library-f">
      <Navbar />
      <MovieList />
    </div>
  );
}

export default MovieLibraryF;
